import ReactDOM from 'react-dom';
import Card from './Card';
import data from'./data';
import './index.css';

function ncard(val) {
	return(
		<Card
	imgsrc={valval.imgsrc}
	title={val.title}
	sname={val.sname}
	link={val.link}
	/>
		);
	// body...
}

ReactDOM.render(<>
	<h1>A TOP FIVE WEB SERIES</h1>
	{data.map(ncard)}

	/>
	</>
	,document.getElementById("root"));
